import React, { useContext } from 'react';
import { Notedata } from './App';

const NoteDetails = () => {
    const data = useContext(Notedata);
    return (
        <>
            {
                data.map((val, ind) => {
                    return (
                        <>
                            <h3>#{ind + 1}</h3>
                            <h4>{val.title}</h4>
                            <p>{val.content}</p>
                        </>
                    )
                })
            }
        </>
    );
}

export default NoteDetails;
